import React from 'react';

const Header = () => {
    return (
        <header className="header">
            <div className="logo">
                <h1>Company</h1>
            </div>
            <nav className="nav">
                <a href="#hero">Home</a>
                <a href="#features">Features</a>
                <a href="#how-it-works">How It Works</a>
                <a href="#testimonials">Testimonials</a>
                <a href="#contact">Contact</a>
            </nav>
        </header>
    );
};

export default Header;
